import React, { useState, useEffect } from 'react';
import {
  AppBar, Toolbar, Typography, Drawer, List, ListItem, ListItemIcon, ListItemText,
  Container, CssBaseline, Box, Grid, Card, CardContent, CardActions, Button,
  Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper,
  TextField, MenuItem, Snackbar, Alert
} from '@mui/material';
import {
  Dashboard as DashboardIcon, People as PeopleIcon, Pets as PetsIcon,
  Person as PersonIcon
} from '@mui/icons-material';

const UserEditForm = ({ user, onSave, onCancel }) => {
  const [formData, setFormData] = useState({
    userId: user.userId,
    name: user.name,
    email: user.email,
    password: '', // Dejar en blanco para no cambiar
    role: user.role
  });
  const [snackbar, setSnackbar] = useState({ open: false, message: '', severity: 'success' });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    
    // Si la contraseña está vacía, no la incluimos en los datos a enviar
    const dataToSend = {...formData};
    if (!dataToSend.password) {
      delete dataToSend.password;
    }

    try {
      const response = await fetch(`http://localhost:8090/bd_petcare/api/users/save`, {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(dataToSend)
      });

      if (!response.ok) {
        const errorData = await response.json();
        throw new Error(errorData.message || 'Error al actualizar el usuario');
      }

      const updatedUser = await response.json();
      setSnackbar({ open: true, message: 'Usuario actualizado correctamente', severity: 'success' });
      onSave(updatedUser);
    } catch (error) {
      console.error('Error:', error);
      setSnackbar({ open: true, message: error.message || 'Error al actualizar el usuario', severity: 'error' });
    }
  };

  const handleCloseSnackbar = () => {
    setSnackbar(prev => ({ ...prev, open: false }));
  };

  return (
    <Paper sx={{ p: 3, mt: 2 }}>
      <Typography variant="h6" gutterBottom>Editar Usuario</Typography>
      <Box component="form" onSubmit={handleSubmit}>
        <TextField
          fullWidth
          margin="normal"
          label="Nombre"
          name="name"
          value={formData.name}
          onChange={handleChange}
          required
        />
        <TextField
          fullWidth
          margin="normal"
          label="Email"
          name="email"
          type="email"
          value={formData.email}
          onChange={handleChange}
          required
        />
        <TextField
          fullWidth
          margin="normal"
          label="Nueva Contraseña (dejar en blanco para no cambiar)"
          name="password"
          type="password"
          value={formData.password}
          onChange={handleChange}
        />
        <TextField
          fullWidth
          margin="normal"
          label="Rol"
          name="role"
          select
          value={formData.role}
          onChange={handleChange}
          required
        >
          <MenuItem value="admin">Administrador</MenuItem>
          <MenuItem value="duenio">Dueño</MenuItem>
          <MenuItem value="veterinario">Veterinario</MenuItem>
          <MenuItem value="asistente">Asistente</MenuItem>
        </TextField>
        <Box sx={{ mt: 2 }}>
          <Button type="submit" variant="contained" color="primary">
            Guardar Cambios
          </Button>
          <Button sx={{ ml: 2 }} onClick={onCancel}>
            Cancelar
          </Button>
        </Box>
      </Box>
      
      <Snackbar
        open={snackbar.open}
        autoHideDuration={6000}
        onClose={handleCloseSnackbar}
      >
        <Alert onClose={handleCloseSnackbar} severity={snackbar.severity} sx={{ width: '100%' }}>
          {snackbar.message}
        </Alert>
      </Snackbar>
    </Paper>
  );
};

const UsersSection = () => {
  const [users, setUsers] = useState([]);
  const [editingUser, setEditingUser] = useState(null);
  const [loading, setLoading] = useState(true);
  const [snackbar, setSnackbar] = useState({ open: false, message: '', severity: 'success' });

  useEffect(() => {
    fetchUsers();
  }, []);

  const fetchUsers = async () => {
    try {
      setLoading(true);
      const response = await fetch('http://localhost:8090/bd_petcare/api/users/all');
      if (!response.ok) {
        throw new Error('Error al cargar usuarios');
      }
      const data = await response.json();
      setUsers(data);
    } catch (error) {
      console.error('Error:', error);
      setSnackbar({ open: true, message: error.message || 'Error al cargar usuarios', severity: 'error' });
    } finally {
      setLoading(false);
    }
  };

  const handleEdit = (user) => {
    setEditingUser(user);
  };

  const handleDelete = async (userId) => {
    if (window.confirm('¿Estás seguro de eliminar este usuario?')) {
      try {
        const response = await fetch(`http://localhost:8090/bd_petcare/api/users/delete/${userId}`, {
          method: 'DELETE'
        });
        
        if (!response.ok) {
          const errorData = await response.json();
          throw new Error(errorData.message || 'Error al eliminar el usuario');
        }
        
        fetchUsers();
        setSnackbar({ open: true, message: 'Usuario eliminado correctamente', severity: 'success' });
      } catch (error) {
        console.error('Error:', error);
        setSnackbar({ open: true, message: error.message || 'Error al eliminar el usuario', severity: 'error' });
      }
    }
  };

  const handleSave = (updatedUser) => {
    setEditingUser(null);
    fetchUsers();
  };

  const handleCancel = () => {
    setEditingUser(null);
  };

  const handleCloseSnackbar = () => {
    setSnackbar(prev => ({ ...prev, open: false }));
  };

  return (
    <>
      {editingUser ? (
        <UserEditForm 
          user={editingUser} 
          onSave={handleSave} 
          onCancel={handleCancel} 
        />
      ) : (
        <>
          {loading ? (
            <Typography>Cargando usuarios...</Typography>
          ) : (
            <TableContainer component={Paper}>
              <Table>
                <TableHead>
                  <TableRow>
                    <TableCell>ID</TableCell>
                    <TableCell>Nombre</TableCell>
                    <TableCell>Email</TableCell>
                    <TableCell>Rol</TableCell>
                    <TableCell>Acciones</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {users.map((user) => (
                    <TableRow key={user.userId}>
                      <TableCell>{user.userId}</TableCell>
                      <TableCell>{user.name}</TableCell>
                      <TableCell>{user.email}</TableCell>
                      <TableCell>{user.role}</TableCell>
                      <TableCell>
                        <Button size="small" onClick={() => handleEdit(user)}>
                          Editar
                        </Button>
                        <Button 
                          size="small" 
                          color="error"
                          onClick={() => handleDelete(user.userId)}
                        >
                          Eliminar
                        </Button>
                      </TableCell>
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </TableContainer>
          )}
        </>
      )}
      
      <Snackbar
        open={snackbar.open}
        autoHideDuration={6000}
        onClose={handleCloseSnackbar}
      >
        <Alert onClose={handleCloseSnackbar} severity={snackbar.severity} sx={{ width: '100%' }}>
          {snackbar.message}
        </Alert>
      </Snackbar>
    </>
  );
};

// (Los componentes OwnersSection y PetsSection permanecen igual que en tu código original)

const Dashboard = () => {
  const [activeSection, setActiveSection] = useState('dashboard');

  const renderSection = () => {
    switch (activeSection) {
      case 'users': return <UsersSection />;
      case 'owners': return <OwnersSection />;
      case 'pets': return <PetsSection />;
      default: return (
        <Grid container spacing={3}>
          <Grid item xs={12} md={6} lg={3}>
            <Card>
              <CardContent>
                <Typography variant="h5">Usuarios</Typography>
                <Typography variant="body2">Gestión de usuarios del sistema</Typography>
              </CardContent>
              <CardActions>
                <Button size="small" onClick={() => setActiveSection('users')}>Ver todos</Button>
              </CardActions>
            </Card>
          </Grid>
          <Grid item xs={12} md={6} lg={3}>
            <Card>
              <CardContent>
                <Typography variant="h5">Dueños</Typography>
                <Typography variant="body2">Gestión de dueños de mascotas</Typography>
              </CardContent>
              <CardActions>
                <Button size="small" onClick={() => setActiveSection('owners')}>Ver todos</Button>
              </CardActions>
            </Card>
          </Grid>
          <Grid item xs={12} md={6} lg={3}>
            <Card>
              <CardContent>
                <Typography variant="h5">Mascotas</Typography>
                <Typography variant="body2">Gestión de mascotas</Typography>
              </CardContent>
              <CardActions>
                <Button size="small" onClick={() => setActiveSection('pets')}>Ver todos</Button>
              </CardActions>
            </Card>
          </Grid>
        </Grid>
      );
    }
  };

  return (
    <Box sx={{ display: 'flex' }}>
      <CssBaseline />
      <AppBar position="fixed" sx={{ zIndex: (theme) => theme.zIndex.drawer + 1 }}>
        <Toolbar>
          <Typography variant="h6" noWrap component="div">
            PetCare Dashboard
          </Typography>
        </Toolbar>
      </AppBar>
      <Drawer
        variant="permanent"
        sx={{
          width: 240,
          flexShrink: 0,
          [`& .MuiDrawer-paper`]: { width: 240, boxSizing: 'border-box' },
        }}
      >
        <Toolbar />
        <Box sx={{ overflow: 'auto' }}>
          <List>
            <ListItem button onClick={() => setActiveSection('dashboard')}>
              <ListItemIcon><DashboardIcon /></ListItemIcon>
              <ListItemText primary="Dashboard" />
            </ListItem>
            <ListItem button onClick={() => setActiveSection('users')}>
              <ListItemIcon><PersonIcon /></ListItemIcon>
              <ListItemText primary="Usuarios" />
            </ListItem>
            <ListItem button onClick={() => setActiveSection('owners')}>
              <ListItemIcon><PeopleIcon /></ListItemIcon>
              <ListItemText primary="Dueños" />
            </ListItem>
            <ListItem button onClick={() => setActiveSection('pets')}>
              <ListItemIcon><PetsIcon /></ListItemIcon>
              <ListItemText primary="Mascotas" />
            </ListItem>
          </List>
        </Box>
      </Drawer>
      <Box component="main" sx={{ flexGrow: 1, p: 3 }}>
        <Toolbar />
        <Container maxWidth="lg">
          {renderSection()}
        </Container>
      </Box>
    </Box>
  );
};

export default Dashboard;
